import classNames from "classnames/bind";
import style from "./style_header.scss";
const Styles = classNames.bind(style);
function Header() {
  return (
    <header className={Styles("header_web_fpt")}>
      <div className={Styles("header_web_fpt_one")}>
        <div className={Styles("flex_header")}>
          <img className={Styles("logo_fpt")} />
          <span className={Styles("span_shop")}>Shop</span>
          <span className={Styles("span_comvn")}>.com.vn</span>
          <form action className={Styles("form_search")}>
            <input
              className={Styles("search")}
              type={Text}
              placeholder="Nhập tên điện thoại, máy tính phụ kiện... cần tìm"
              autoComplete="off"
              required
            />
            <button className={Styles("button")}>
              <i class="fas fa-search"></i>
            </button>
          </form>
          <ul className={Styles("ul_header")}></ul>
        </div>
      </div>
    </header>
  );
}

export default Header;
